function _qrDecode(e: any, t: any) {
  let ZXing = _.get(window, 'ZXing') as any;
  const n = new ZXing.BrowserMultiFormatReader();
  let s = new Image();
  (s.src = e),
    s.setAttribute('crossOrigin', 'Anonymous'),
    (s.onload = function () {
      n.decodeFromImage(this)
        .then((n: any) => {
          t(n);
        })
        .catch((n: any) => {
          t(n);
        });
    }),
    (s.onerror = function (e) {
      //
    });
}

